var $_documentContainer=document.createElement("div");$_documentContainer.setAttribute("style","display: none;");$_documentContainer.innerHTML="<style is=\"custom-style\">\n  :host > * {\n    --iron-data-table: {\n      font: 400 100%/1.5 Roboto, sans-serif;\n      font-size: 13px;\n      font-weight: 400;\n      line-height: 1.1;\n      color: rgba(0, 0, 0, 0.87);\n    };\n\n    --iron-data-table-header: {\n      background-color: #fafafa;\n      color: rgba(0, 0, 0, 0.54);\n      font-size: 12px;\n      font-weight: 600;\n      height: 56px;\n    };\n\n    --iron-data-table-row: {\n      border-bottom: 1px solid #e3e3e3;\n    };\n\n    --iron-data-table-row-hover: {\n      background-color: #eee;\n    };\n\n    --iron-data-table-row-selected: {\n      color: var(--default-primary-color, #03A9FA);\n    };\n\n    --iron-data-table-row-after: {\n      background-color: var(--default-primary-color, #03A9F4);\n      bottom: 0;\n      content: \"\";\n      height: 2px;\n      left: 0;\n      pointer-events: none;\n      position: absolute;\n      right: 0;\n      transition: all 0.16s ease-in-out;\n\n      -webkit-transform: scaleX(0.0);\n      transform: scaleX(0.0);\n      z-index: 1;\n    };\n\n    --iron-data-table-row-focused: {\n      background-color: #eee;\n    };\n\n    --iron-data-table-row-focused-after: {\n      -webkit-transform: scaleX(1.0);\n      transform: scaleX(1.0);\n    };\n  }\n</style>";document.head.appendChild($_documentContainer);